[[File:Bronze key red detail.png|left|140px]]
'''Bronze key red''' is a key and reward from the [[Shades of Mort'ton (minigame)|Shades of Mort'ton]] [[Minigames|minigame]], which is played in [[Mort'ton]]. To obtain it, the player must kill either a [[Loar Shade]] or a [[Phrin Shade]] and then burn its remains on a pyre. This key may also be a random reward from giving an [[afflicted]] a dose of [[serum 208]]. The key may be used to enter the [[Shade Catacombs]] and then open the [[Bronze Chest (red)|correctly coloured chest]], players can only open bronze doors with these keys within the tomb. It will open a bronze-framed chest with a dark red lock.

